sourcesContent:
const express = require("express");
const app = express();
require("dotenv").config();
const port = process.env.PORT ?? 3000;
const route = require("./routes/index");

app.use(express.json());
express.urlencoded({
  extended: true,
});

route(app);

app.listen(port, () => {
  console.log(`Example app listening on port ${port}`);
});

