const Sequelize = require("sequelize");
const db = require("../models/index");
import insertProductRequest from "../dtos/request/insertProductRequest";
class ProductController {
  async getProduct(req, res) {
    try {
      const product = await db.Product.findAll();
      res.status(200).json({ message: "Ly thnh cng", data: product });
    } catch (err) {
      res
        .status(500)
        .json({ message: "Li khi ly sn phm", errors: err.message });
    }
  }
  async getProductById(req, res) {
    res.status(200).json({ message: "Ly thnh cng ID sn phm" });
  }
  async insertProduct(req, res) {
    const { error } = insertProductRequest.validate(req.body);
    if (error) {
      return res.status(400).json({
        message: "Li khi thm sn phm mi",
        errors: error.details[0]?.message,
      });
    }
    try {
      const product = await db.Product.create(req.body);
      res.status(201).json({ message: "Thm mi thnh cng", data: product });
    } catch (err) {
      res
        .status(500)
        .json({ message: "Li khi thm sn phm mi", errors: err });
    }
  }
  async deleteProduct(req, res) {
    res.status(200).json({ message: "Xo thnh cng" });
  }
  async updateProduct(req, res) {
    res.status(200).json({ message: "Sa thnh cng" });
  }
}

module.exports = new ProductController();

