const Sequelize = require("sequelize");
const db = require("../models/index");
class CategoryController {
  async getCategory(req, res) {
    res.status(200).json({ message: "Ly thnh cng" });
  }
  async getCategoryById(req, res) {
    res.status(200).json({ message: "Ly thnh cng ID " });
  }
  async insertCategory(req, res) {
    try {
      const category = await db.Category.create(req.body);
      res
        .status(201)
        .json({ message: "Thm category thnh cng", data: category });
    } catch (err) {
      res
        .status(500)
        .json({ message: "Li khi thm category", errors: err.message });
    }
  }
  async deleteCategory(req, res) {
    res.status(200).json({ message: "Xo thnh cng" });
  }
  async updateCategory(req, res) {
    res.status(200).json({ message: "Sa thnh cng" });
  }
}

module.exports = new CategoryController();

