        foreignKey: "news_id",
      });
    }
  }
  News_detail.init(
    {
      product_id: DataTypes.INTEGER,
      news_id: DataTypes.INTEGER,
    },
    {
      sequelize,
      modelName: "News_detail",
      tableName: "news_details",
      underscored: true,
    }
  );
  return News_detail;
};

