sourcesContent:
const Sequelize = require("sequelize");
const db = require("../models/index");
class BrandController {
  async getBrand(req, res) {
    res.status(200).json({ message: "Ly danh sch brand thnh cng" });
  }

  async getBrandById(req, res) {
    res.status(200).json({ message: "Ly brand theo ID thnh cng" });
  }

  async insertBrand(req, res) {
    try {
      const brand = await db.Brand.create(req.body);
      res.status(201).json({ message: "Thm brand thnh cng", data: brand });
    } catch (err) {
      res
        .status(500)
        .json({ message: "Li khi thm brand", error: err.message });
    }
  }

  async deleteBrand(req, res) {
    res.status(200).json({ message: "Xo brand thnh cng" });
  }

  async updateBrand(req, res) {
    res.status(200).json({ message: "Cp nht brand thnh cng" });
  }
}

module.exports = new BrandController();

