  async getOrder(req, res) {
    res.status(200).json({ message: "Ly danh sch order thnh cng" });
  }

  async getOrderById(req, res) {
    res.status(200).json({ message: "Ly order theo ID thnh cng" });
  }

  async insertOrder(req, res) {
    res.status(200).json({ message: "Thm order thnh cng" });
  }

  async deleteOrder(req, res) {
    res.status(200).json({ message: "Xo order thnh cng" });
  }

  async updateOrder(req, res) {
    res.status(200).json({ message: "Cp nht order thnh cng" });
  }
}

module.exports = new OrderController();

